import React, { useState, useEffect } from "react";
import DataTable from 'react-data-table-component';

export default function Cablecom(url){
    var userurl= url
    const [data, setData] = useState(null);
    useEffect(()=>{
      fetch(userurl)
        .then(response => response.json())
        .then((data) => setData(data));
      },[]);

      const columns = [
        {
          name: 'Name',
          selector: 'name',
          sortable: true,
        },
        {
          name: 'Phone',
          selector: 'phone',
          sortable: true,
        },
        {
          name: 'Email',
          selector: 'email',
          sortable: true,
        },
        {
          name: 'DOB',
          selector: 'dob',
        },
      ];
    return(
        <DataTable columns={columns}/>


    )

}
